import { Link } from 'react-router-dom';

export const ProductsPage = () => {
	return (
		<>
			<h1>The Products Page</h1>
			<ul>
				<li>
					<Link to="/products/product-1">Product one</Link>
				</li>
				<li>
					<Link to="/products/product-1"> Product two</Link>
				</li>
				<li>
					<Link to="/products/product-1">Product three</Link>
				</li>
			</ul>
		</>
	);
};
